import styled from "../views/Form.module.css";

const Form = () => {
  return (
    <div style={{ color: "green" }}>
      <form className={styled.formP}>
        <div>
          <label htmlFor="">Gmail:</label>
          <input type="email" />
        </div>

        <div>
          <label htmlFor="">Username:</label>
          <input type="text" />
        </div>

        <div>
          <label htmlFor="">Password:</label>
          <input type="Text" />
        </div>

        <button className={styled.fButton} type="button">Login</button>
      </form>
    </div>
  );
};

export default Form;
